import React from "react";
import "./FlyingSnowman.css";

const FlyingSnowman = ({ mouseX, mouseY }) => {
  const snowmanStyle = {
    left: mouseX + "px",
    top: mouseY + "px",
  };

  return (
    <div className="flying-snowman" style={snowmanStyle}>
      hello
    </div>
  );
};

export default FlyingSnowman;
